function HomePage () {
  return (
    <div>
      <div className='mainHeader'>
        <div className='displayPic'/>
        <h1> Tom Doyle</h1>
      </div>
      <div className='mainBody'>
        <h3>About me:</h3>
      </div>
    </div>
  )
}

export default HomePage;
